#  Find the contiguous subarray within an array (containing at least one number) which has the largest product.
#
# For example, given the array [2,3,-2,4],
# the contiguous subarray [2,3] has the largest product = 6.

# Enumeration
class Solution:
    # @param A, a list of integers
    # @return an integer
    def maxProduct(self, A):
        maxProduct = -float("inf")
        for i in range(len(A)):
            product = 1
            for j in range(i, len(A)):
                product *= A[j]

                if product > maxProduct:
                    maxProduct = product

                if product == 0:
                    break

        return maxProduct

# Dynamic programming
class Solution2:
    # @param A, a list of integers
    # @return an integer
    def maxProduct(self, A):
        maxProduct = -float("inf")
        products = [[1 for j in range(len(A))] for i in range(len(A))]

        for length in range(len(A)):
            for start in range(len(A)-length):
                if length == 0:
                    products[start][start] = A[start]
                else:
                    products[start][start+length] = products[start][start+length-1] * products[start+length][start+length]

                    if products[start][start+length] > maxProduct:
                        maxProduct = products[start][start+length]

        return maxProduct

# Double array: keep record of both max and min
class Solution3:
    # @param A, a list of integers
    # @return an integer
    def maxProduct(self, A):
        A.insert(0, 1)
        max_result = -float("inf")
        book_max = [1]
        book_min = [1]

        for i in range(1, len(A)):
            book_max.append(max(A[i], A[i]*book_max[i-1], A[i]*book_min[i-1]))
            book_min.append(min(A[i], A[i]*book_max[i-1], A[i]*book_min[i-1]))
            if book_max[i] > max_result:
                max_result = book_max[i]

        return max_result


